    false,nt"url": null,nt"notes": "Spatial vegetation/habitat database produced
    for Camas National Wildlife Refuge (NWR). This project occurred over the time period
    from Spring 2011 to Fall 2012. It was funded through the USFWS Inventory and Monitoring
    Initiative. Final geodatabase of Camas NWR vegetation mapping products. This geodatabase
    includes 4 polygon-based feature classes representing different scales and levels
    of detail: 1) Full spatial detail, over 16,000 polygons mapped to Group and Alliance
    level. Includes all upper levels in the NVCS. 2) "Dissolved" polygons at the level
    of NVCS Groups and Alliances. 3) "Dissolved" Polygons at the thematic level of
    CCP habitat types. 4) Full spatial detail, with additional structural and cover
    information. This geodatabase also includes all field data: points associated with
    an parallel Ecological Integrity Assessment, training points, validation points,
    and accuracy assessment points.",nt"license_title": "License Not Specified",nt"extras":
